import React, { Component } from 'react';
import StudentLayout from './StudentLayout';
import './student_page.css';
import Header from '../../'

class StudentPage extends Component {
    render() {
        return (
            <div className="">
                <Header />
                <StudentLayout />
            </div>
        );
    }
}

export default StudentPage;
